
function convert2bpp1bpp(inData, inBpp) {
    const width = 240;
    const height = 240;
    const outBpp = 1;

    const inPixelsPerByte = 8 / inBpp;
    const outPixelsPerByte = 8 / outBpp;
    const inStride = width / inPixelsPerByte;
    const outStride = width / outPixelsPerByte;

    const inRangeShift = 3 - Math.log2(inBpp);
    const outRangeShift = 3 - Math.log2(outBpp);

    const outData = Array(outStride * height).fill(0);

    for (let y = 0; y < height; y++) {
        //const line = [];
        for (let x = 0; x < width; x++) {
            const inIndex = y * inStride + Math.floor(x / inPixelsPerByte);
            const inOfs = ((1 << inRangeShift) - 1) - (x & ((1 << inRangeShift) - 1));
            const inShift = inOfs * inBpp;
            const inMask = (1 << inBpp) - 1;

            const outIndex = y * outStride + Math.floor(x / outPixelsPerByte);
            const outOfs = ((1 << outRangeShift) - 1) - (x & ((1 << outRangeShift) - 1));
            const outShift = outOfs * outBpp;
            const outMask = (1 << inBpp) - 1;

            const inValue = (inData[inIndex] >> inShift) & inMask;
            const outValue = (inValue > 0) ? (1 << outBpp) - 1 : 0;

            outData[outIndex] |= (outValue & outMask) << outShift;

            //line.push(outValue ? '#' : ((x & 3) == 0 ? ':' : '.'));
        }
        //console.log(line.join(''));
    }

    return outData;
}

function hexDump(data, width) {
    for (let i = 0; i < data.length + width - 1; i += width) {
        const line = [];
        for (let j = 0; j < width; j++) {
            if (i + j < data.length) {
                line.push('0x' + data[i + j].toString(16).padStart(2, '0'));
            }
        }
        if (line.length > 0) console.log('  ' + line.join(', ') + ', ' + '// Line ' + Math.floor(i / width));
    }
}


